  `owner_id` bigint NULL DEFAULT NULL COMMENT '负责人id',
  `description` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '描述',
